 import "./index";
 import Somu from "./somu";
 import Suni from "./suni";
 import { BrowserRouter as Router,Routes,Route,Link } from "react-router-dom";
function Home(){
    return(
        <div>
            <Router>
           <ul>
            <li><Link to={"/navi"}>Somu</Link></li>
            <li>Suni</li>
           </ul>

           <Routes>

            <Route path="/navi" element={<Somu/>}/>

           </Routes>
           </Router>

        </div>
    )
}
export default Home;
